import React from "react";
import "./authorization.styles.css";

export const Authorization = () => {
  return (
    <div className="authorization-main-container">
      <h2 className="authorization-header">Please Log In </h2>
      <form className="login-form" action="">
        <input id="login-email" type="email" placeholder="Your Email" />
        <input
          id="login-password"
          type="password"
          placeholder="Your Password"
        />
      </form>

      <div className="registration-container">
        <h3 className="registration-header">
          Don't have an account? Register now!
        </h3>
      </div>
    </div>
  );
};
